###### Article 4

Les organes du Conseil National du Travail sont:
- la Plénière;
- le Président;
- les Groupes de Représentants de l'Etat, des
travailleurs et des employeurs;
- les Commissions ad hoc;
- l'Equipe technique;
- le Secrétariat.

###### Article 6

Le bureau a pour rôles de :
- préparer un calendrier et un plan de travail ;
- préparer l’ordre du jour des réunions de la
Coordination ;
- convoquer et présider les réunions ;
- rédiger les procès-verbaux des réunions ;
- garder les archives ;
- identifier d’autres acteurs clés ;
- faire le plaidoyer en vue de la mobilisation des
fonds en faveur des OEV ;
- échanger les informations avec les Coordinations
provinciales et, le cas échéant, recueillir les
besoins en appui technique.
